import React from 'react';
import Main from './components/MainComponent';

import 'bootstrap/dist/css/bootstrap.min.css';
import 'font-awesome/css/font-awesome.css';
import './App.css';

function App() {
  return (
    <div className='App'>
      <Main />
    </div>
  );
}

export default App;
